(201, 'Hiking Competition', '2022-07-11', '05:30:28', 'Adventure Activity', 'To grab the attention of public who\'ll be attending the big day, Jayciana, many pre fest events are going to be held, and one such is a hiking activity by a college club Sahas. Here, the group which reaches the peak of the mountain first wins.', 600, 1000, 56, 222, '206730'),
(301, '||SHABD||', '2022-07-19', '10:30:00', 'Cultural and Literary Fest', 'The Editorial Board is responsible for bringing out the annual university magazine-Jayzine and organizing the annual literary fest of JSSSTU-||SHABD||\r\nIt\'s time to unleash your words, creativity and inquisitive minds!!\r\nLooking at the enthusiasm and passion of this year\'s participants, we\'re sure this year\'s fest will be no different.\r\nThe events include: Painting, Creative Writing(English, Hindi and kannada), Debate.  ', 75, 120, 104, 333, '202754'),
