(501, 'FOSS BYTES', '2022-07-12', '05:30:32', 'Technical Event', 'Linux Campus Club from the department of Computer Science, brings to you FossBytes, our annual event filled with lots of knowledge and fun!!!\r\n\r\nWe have DeCrypto(Connect the dots), Code Blind(Test your coding skills!) and Code Mine(Mine your way out of a field of puzzles).\r\n\r\nFor queries, contact: \r\nSammy: +918763598472', 120, 140, 100, 333, '202045'),
(601, 'EBSB DAY', '2022-07-15', '10:30:00', 'Cultural Event', 'EBSB JSS STU Club Presents,\r\nEBSB DAY!!!\r\nINAUGURATION OF EBSB_JSS_STU_CLUB,\r\nFOLLOWED BY ETHNIC DAY \r\nTime to put on your dancing moves to the rythm of your heart \r\nMusic is the literature of the heart, it commences where speech ends!!!', 150, 180, 102, 333, '204051');

